    public static List<Integer> findSubstring(String s, String[] words) {
        ArrayList<Integer> list = new ArrayList<>();
        String words_str = Arrays.toString(words).replace("[","")
                .replace("]","").replaceAll(", ","");
        //System.out.println(words_str);
        //Âõ†‰∏∫words‰∏≠ÂçïËØçÈïøÂ∫¶ÈÉΩÁõ∏ÂêåÔºåÂÖàÊãøÂà∞ÈïøÂ∫¶
        int len = words[0].length();
        //ÈÅçÂéÜs,‰ªé0Âà∞0+lenÔºå0+len+len..
        StringBuilder res = new StringBuilder();

        for (int i = 0; i <= s.length() - words_str.length(); i++) {
            String substring = s.substring(i, i + words_str.length());
            /*System.out.print(substring);
            System.out.println(i);*/
            //Èó¥ÈöîÈïøÂ∫¶ÂèñÂá∫Êù•,Âä†‰∏Ä‰∏™@ÊãºÊé•
            //StringBuilder sb = new StringBuilder(substring);
            StringBuilder sb = new StringBuilder();
            //StringBuffer sb = new StringBuffer();

            for (int k = 0; k < substring.length(); k+=len) {
                sb.append(substring.substring(k,k+len)).append("@");
            }
            /**
             * ‰∏ãÈù¢Ëøô‰∏™ÊñπÊ≥ïÁ´üÁÑ∂ÊØî‰∏äÈù¢ÁöÑËøòË¶ÅÊÖ¢„ÄÇ„ÄÇ
             */
            /*//‰ΩøÁî®sbÁöÑÊèíÂÖ•,Âõ†‰∏∫‰∏çÊñ≠ÊèíÂÖ•ÁöÑËøáÁ®ã‰∏≠ÈïøÂ∫¶Âú®ÂèëÁîüÂèòÂåñÔºåÊâÄ‰ª•ÈúÄË¶Å‰∏Ä‰∏™tempÊù•‰ª£Êõø
            int temp = 0;
            for (int j = len; j <= substring.length(); j+=len) {
                sb.insert(j+temp,"@");
                temp++;
            }*/

            //
            substring = sb.toString();
            //System.out.println(substring);
            int j = 0;
            for (; j < words.length; j++) {
                //System.out.print(substring+"  ");
                if (substring.contains(words[j]+"@")){
                    substring = substring.replaceFirst(words[j]+"@","");
                }
                else break;/*j+=10000000 * len;*/   //Ëøô‰∏™Â¶Ç‰ΩïËµ∑‰ΩúÁî®Ôºüüòê
            }
            if (substring.isEmpty()) list.add(i);
        }
        return list;
    }
